import {Component} from 'react';
import './mentees.css';

import DisplayMentees from './displayMentees';
import MenteeCreationForm from './menteeCreationForm';



class Mentees extends Component{

    render(){
        return(
            <div>
                <DisplayMentees />
                <MenteeCreationForm />
            </div>
        )
    }
}



export default Mentees;
